import ecommerce_cart from "../../styles/ecommerce_cart.png";
import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from 'react-responsive-carousel';



export const ProjectSection = () => {
      return (
          <Carousel width="700px">
              <div>
                  <img src={ecommerce_main} {...getConfigurableProps()} animationHandler="fade" swipeable={false}/>

              </div>
              <div>
                  <img src={ecommerce_product} />

              </div>
              <div>
                  <img src={ecommerce_cart} />

              </div>
          </Carousel>
      );
  };





